import React, { Component } from "react";

class Features extends Component {
  state = {
    count: 0,
    yearBuilt: 1969,
    taxAmount: 4542.86,
    noOfBathrooms: 2,
    noOfBedrooms: 3,
    area: 1476,
  };

  render() {
    return (
      <React.Fragment className="bg-primary">
        <div
          style={{
            fontSize: 40,
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
            height: "100vh",
          }}
          className="badge bg-primary pull-right"
        >
          House Price Predictor
        </div>
      </React.Fragment>
    );
  }
}

export default Features;
